131f6c022000a2d0e7b","created_at":1430144526,"favorited_by":["9011917"],"group_id":"12119607","id":"143014452694028037","name":"Justin Hade","sender_id":"12612522","sender_type":"user","source_guid":"android-4401966b-3432-4dc8-acde-19e584513433","system":false,"text":"Please see the updated dog tab.  I organized it by your name and market so that you can easily update the main document without making copies","user_id":"12612522"},{"attachments":[{"type":"image","url":"http://i.groupme.com/720x1280.png.2ac85b3cc06247de89b351df4fa71f0e"}],"avatar_url":"https://i.groupme.com/2560x1920.jpeg.5a988f20b62a0131f6c022000a2d0e7b","created_at":1430140642,"favorited_by":["9011917"],"group_id":"12119607","id":"143014064229059890","name":"Justin Hade","sender_id":"12612522","sender_type":"user","source_guid":"android-78a7214f-fa1b-4362-92d3-d4b0e6349171","system":false,"text":"GREAT MORNING TO YOU BLUE","user_id":"12612522"},{"attachments":[],"avatar_url":"https://i.groupme.com/2560x1920.jpeg.5a988f20b62a0131f6c022000a2d0e7b","created_at":1430140568,"favorited_by":["9011917"],"group_id":"12119607","id":"143014056816687296","name":"Justin Hade","sender_id":"12612522","sender_type":"user","source_guid":"android-021de8a1-6aec-47da-b92a-8a39a338fb37","system":false,"text":"Everyone please be ready for the recruiting call in just about an hour. ","user_id":"12612522"},{"attachments":[],"avatar_url":"http://i.groupme.com/1080x720.jpeg.27bfe979124e4c3bbed2a3bc84117f46","created_at":1430137865,"favorited_by":["21047326"],"group_id":"12119607","id":"143013786533409361","name":"Chris Lee","sender_id":"9011917","sender_type":"user","source_guid":"a61d5d190471e82b85b25e5b91e29511","system":false,"text":"In the meantime I am going to try Backpages.com in two cities and see what I get.","user_id":"9011917"},{"attachments":[{"loci":[[0,12]],"type":"mentions","user_ids":["12612522"]}],"avatar_url":"http://i.groupme.com/1080x720.jpeg.27bfe979124e4c3bbed2a3bc84117f46","created_at":1430137838,"favo