        {"response":{"count":560,"messages":[{"attachments":[{"type":"image","url":"http://i.groupme.com/720x1280.png.5e2289d933884fd39be8c002d634efcd"}],"avatar_url":"https://i.groupme.com/2560x1920.jpeg.5a988f20b62a0131f6c022000a2d0e7b","created_at":1429912217,"favorited_by":[],"group_id":"7932217","id":"142991221709707481","name":"RBD - Justin Hade","sender_id":"12612522","sender_type":"user","source_guid":"android-6b8db7c4-12c0-48e0-b979-d255d85bb046","system":false,"text":"Now status 500","user_id":"12612522"},{"attachments":[],"avatar_url":"https://i.groupme.com/2560x1920.jpeg.5a988f20b62a0131f6c022000a2d0e7b","created_at":1429907802,"favorited_by":[],"group_id":"7932217","id":"142990780242772403","name":"RBD - Justin Hade","sender_id":"12612522","sender_type":"user","source_guid":"android-6f3d48ec-efcc-4c2d-ae35-574e660ace06","system":false,"text":"Any ETA on resolution if it's already known? ","user_id":"12612522"},{"attachments":[],"avatar_url":"https://i.groupme.com/2560x1920.jpeg.5a988f20b62a0131f6c022000a2d0e7b","created_at":1429907766,"favorited_by":[],"group_id":"7932217","id":"142990776667506142","name":"RBD - Justin Hade","sender_id":"12612522","sender_type":"user","source_guid":"android-65866381-6ad6-470f-9ed9-2254c7e53f61","system":false,"text":"Boostmobile.com/activate","user_id":"12612522"},{"attachments":[{"type":"image","url":"http://i.groupme.com/720x1280.png.19dae982c34f4dd78a64bf1c0b487208"}],"avatar_url":"https://i.groupme.com/2560x1920.jpeg.5a988f20b62a0131f6c022000a2d0e7b","created_at":1429907762,"favorited_by":[],"group_id":"7932217","id":"142990776262715672","name":"RBD - Justin Hade","sender_id":"12612522","sender_type":"user","source_guid":"android-54975ba4-954a-45fb-bbb5-347a547b8c98","system":false,"text":"Sites been down for activating Boosf","user_id":"12612522"},{"attachments":[{"loci":[[7,20]],"type":"mentions","user_ids":["7356738"]}],"avatar_url":"https://i.groupme.com/1276x1280.jpeg.e88e51004bfd0131dbd322000a2d16e3","created_at":1429219988,"favorited_by":[],"group_id":"7932217","id":"142921998808018037","name":"Carter","sender_id":"15719013","sender_type":"user","source_guid":"E6B465A2-9130-43FE-B0C5-524F076FDBE8","system":false,"text":"Thanks @S - Scott  Galliart. That's Brent he typical process. I'll confirm that with the store manager","user_id":"15719013"},{"attachments":[],"avatar_url":"http://i.groupme.com/320x180.png.e1f3bb67863a4936a0d228e86e540e83","created_at":1429219050,"favorited_by":["15719013"],"group_id":"7932217","id":"142921905088011684","name":"S - Scott  Galliart","sender_id":"7356738","sender_type":"user","source_guid":"android-21702f0e-ad38-4f4d-88c7-9d9ff45b5127","system":false,"text":"The manager should be able to accept the 3 price drops in the system.  ","user_id":"7356738"},{"attachments":[{"loci":[[27,8]],"type":"mentions","user_ids":["15719013"]}],"avatar_url":"https://i.groupme.com/2560x1920.jpeg.5a988f20b62a0131f6c022000a2d0e7b","created_at":1429217523,"favorited_by":["15719013"],"group_id":"7932217","id":"142921752306015813","name":"RBD - Justin Hade","sender_id":"12612522","sender_type":"user","source_guid":"android-d74b95af-2dd9-48e8-a15e-18e2b1903027","system":false,"text":"I'll get some more details @Carter   We're walking reps/managers through the processes.   Any that cannot be changed will be rolled up at the end of the night.   I just wanted to post the first instance to see if there was any proactive communication to the Walmart.  I just heard of another store #800 on a trust call.   The manager asked us not to pitch these prices because they don't see the price drop.  ","user_id":"12612522"},{"attachments":[],"avatar_url":"https://i.groupme.com/1276x1280.jpeg.e88e51004bfd0131dbd322000a2d16e3","created_at":1429216983,"favorited_by":[],"group_id":"7932217","id":"142921698392576566","name":"Carter","sender_id":"15719013","sender_type":"user","source_guid":"CCE6B063-9D5A-44FB-9DFA-F5759FA4C699","system":false,"text":"I'll escalate that door. Any others?","user_id":"15719013"},{"attachments":[{"type":"image","url":"http://i.groupme.com/540x960.png.4ba235ccf9074e3899cb8b9d499716cb"}],"avatar_url":"https://i.groupme.com/2560x1920.jpeg.5a988f20b62a0131f6c022000a2d0e7b","created_at":1429211709,"favorited_by":["15719013"],"group_id":"7932217","id":"142921170933553891","name":"RBD - Justin Hade","sender_id":"12612522","sender_type":"user","source_guid":"android-58371750-7a88-4cba-9c7d-7be9c26368f9","system":false,"text":null,"user_id":"12612522"},{"attachments":[],"avatar_url":"https://i.groupme.com/2560x1920.jpeg.5a988f20b62a0131f6c022000a2d0e7b","created_at":1429211539,"favorited_by":["15719013"],"group_id":"7932217","id":"142921153996196225","name":"RBD - Justin Hade","sender_id":"12612522","sender_type":"user","source_guid":"android-c7a4a32b-299d-4209-b5a9-e2044c3a9922","system":false,"text":"Question - what if we're encountering stores that don't see the price drop in Telzon gun.  Store 5118 in Raleigh for example.   We're trying to get all stores to update pricing.   This store is having inventory issues, and the lower process would help.   It's there anything we can do? ","user_id":"12612522"}]},"meta":{"code":200}}
